-(NSString*)name{
    switch (_category) {
        case CardCategoryChallenge:return @"CHALLENGE DECK";
        case CardCategoryKick:return @"KICK DECK";
        case CardCategoryMove:return @"MOVE DECK";
        case CardCategorySpecial:return @"SPECIAL DECK";
        default: return @"** ERROR, NO DECK TYPE **";
    }
}

-(NSInteger)newSeed{

    NSUInteger newSeed = arc4random() % 9600;
    //NSLog(@"new seed: %ld", newSeed);
    return newSeed;
    
}

-(int) randomForIndex:(int)index {
    return randChart[index];
}

-(void)shuffleWithSeed:(NSInteger)seed fromDeck:(NSArray*)deck {
    
    shuffleCount++;
    
    NSLog(@"--------------- SHUFFLE --------------------");

    NSMutableArray *cardsMutable = [NSMutableArray arrayWithArray:deck];
    
    for (int i = 0; i < cardsMutable.count; ++i){
        
    //double next = (((_seed= 1664525*_seed + 1013904223)>>16) / (double)0x10000);
        
      // NSLog(@"rand float :%f", next);
       
//        if (next > .99) {
//            next = .99;
//        }
        
       // int newIndex = next*cardsMutable.count;
       // NSLog(@"SEED: %d", seed);
        
        NSInteger newIndex = randChart[seed+i] % cardsMutable.count;
        
        [cardsMutable exchangeObjectAtIndex:i withObjectAtIndex:newIndex];
        //NSLog(@"swap %d with %d", i, newIndex);
        
        
    }
    
    // ASSIGN LOCATION
    
    for (int i = 0; i < cardsMutable.count; ++i){
        [cardsMutable[i] setLocation:[BoardLocation pX:100+shuffleCount Y:i]];
          //  NSLog(@"%d :%@", i, [cardsMutable[i] name]);
    }
    
    _theDeck = cardsMutable;

   
    
}

-(void)revertToSeed:(NSInteger)seed fromDeck:(NSArray*)deck {
    
    shuffleCount--;
    
    _seed = seed;
    
    NSMutableArray *cardsMutable = [NSMutableArray arrayWithArray:deck];
    
    for (int i = cardsMutable.count-1; i >= 0; --i){
        
        //double next = (((_seed= 1664525*_seed + 1013904223)>>16) / (double)0x10000);
        
        // NSLog(@"rand float :%f", next);
        
        //        if (next > .99) {
        //            next = .99;
        //        }
        
        // int newIndex = next*cardsMutable.count;
        
        NSInteger newIndex = randChart[seed+i] % cardsMutable.count;
        
        [cardsMutable exchangeObjectAtIndex:i withObjectAtIndex:newIndex];
        //NSLog(@"swap %d with %d", i, newIndex);
        
        
    }
    
    // ASSIGN LOCATION
    
    for (int i = 0; i < cardsMutable.count; ++i){
        [cardsMutable[i] setLocation:[BoardLocation pX:100+shuffleCount Y:i]];
        //NSLog(@"%d :%@", i, [cardsMutable[i] name]);

    }
    
    _theDeck = cardsMutable;
    
    
    
}

-(Card*)turnOverNextCardForEvent:(GameEvent*)event{
    
    if (!_theDeck.count) {
        [self shuffleWithSeed:event.seed fromDeck:_discarded];
        _discarded = nil;
    }
    
    NSMutableArray *cardsMutable = [NSMutableArray arrayWithArray:_theDeck];
    NSMutableArray *inHandMutable = [NSMutableArray arrayWithArray:_inHand];
    
    Card *card = [cardsMutable lastObject];
    
    //NSLog(@"deck.m : getting card %@ from deck", card.name);
          
    [inHandMutable addObject:card];
    [cardsMutable removeObject:card];
    
    _theDeck = cardsMutable;
    _inHand = inHandMutable;
    
    //card.location = [BoardLocation pX:101 Y:card.location.y];
    
    if (!card) {
        NSLog(@"ERROR DIDN'T GET A CARD FROM DECK");
    }
    return card;
}

-(BOOL)playCardFromHand:(Card*)card{
    NSMutableArray *inHandMutable = [NSMutableArray arrayWithArray:_inHand];
    NSMutableArray *inGameMutable = [NSMutableArray arrayWithArray:_inGame];
    
    for(Card *element in _inHand){
        if([element isEqual:card]){
            [inGameMutable addObject:element];
            [inHandMutable removeObject:element];
            _inHand = inHandMutable;
            _inGame = inGameMutable;
            return true;
        }
    }
    return false;
}

-(BOOL)playCardFromDeck:(Card*)card{
    
    NSMutableArray *cardsMutable = [NSMutableArray arrayWithArray:_theDeck];
    NSMutableArray *ingameMutable = [NSMutableArray arrayWithArray:_inGame];
    for(Card *element in _theDeck){
        
        if([element isEqual:card]){
            [ingameMutable addObject:element];
            [cardsMutable removeObject:element];
            _theDeck = cardsMutable;
            _inGame = ingameMutable;
            return true;
        }
        
    }
    return false;
}


-(BOOL)discardCardFromHand:(Card*)card {
    
    BOOL success = false;
    NSMutableArray *discardedMutable = [NSMutableArray arrayWithArray:_discarded];
    NSMutableArray *setMutable = [NSMutableArray arrayWithArray:_inHand];
    
    for(Card *element in _inHand){
        if(!success && [element isEqual:card]){
            
            [discardedMutable addObject:element];
            [setMutable removeObject:element];
            
            _discarded = discardedMutable;
            _inHand = setMutable;
            
            //card.location = [BoardLocation pX:-100 Y:_discarded.count];
            NSLog(@"in hand %d, discarded %d", _inHand.count,_discarded.count);
            
            success = true;
        }
    }
    return success;
}

-(BOOL)discardCardFromDeck:(Card*)card {
    
    BOOL success = false;
    NSMutableArray *discardedMutable = [NSMutableArray arrayWithArray:_discarded];
    NSMutableArray *setMutable = [NSMutableArray arrayWithArray:_theDeck];
    
    for(Card *element in _theDeck){
        if(!success && [element isEqual:card]){
            
            [discardedMutable addObject:element];
            [setMutable removeObject:element];
            
            _discarded = discardedMutable;
            _theDeck = setMutable;
            
            //card.location = [BoardLocation pX:-100 Y:_discarded.count];
//            NSLog(@"in deck count %d", _theDeck.count);
//            NSLog(@"Discard, pile is %d", _discarded.count);
            
            success = true;
        }
    }
    return success;
}

-(BOOL)discardCardFromGame:(Card*)card {
    
    BOOL success = false;
    NSMutableArray *discardedMutable = [NSMutableArray arrayWithArray:_discarded];
    NSMutableArray *setMutable = [NSMutableArray arrayWithArray:_inGame];
    
    for(Card *element in _inGame){
        if(!success && [element isEqual:card]){
            
            [discardedMutable addObject:element];
            [setMutable removeObject:element];
            
            _discarded = discardedMutable;
            _inGame = setMutable;
            
            //card.location = [BoardLocation pX:-100 Y:_discarded.count];
            NSLog(@"in game %d, discarded %d", _inGame.count,_discarded.count);
            
            success = true;
        }
    }
    return success;
}

#pragma NSCODER

-(void)setPlayer:(Player *)player {
    _player = player;
    
    for (Card* c in _allCards){
        c.deck = self;
    }
    
}

- (id)initWithCoder:(NSCoder *)decoder {
    self = [super init];
    
    if (!self) {
        return nil;
    }
    
    _player = [decoder decodeObjectForKey:NSFWKeyPlayer];
    _allCards = [decoder decodeObjectForKey:@"theDeck"];
    
    return self;
}

- (void)encodeWithCoder:(NSCoder *)encoder {
    
    [encoder encodeObject:_player forKey:NSFWKeyPlayer];
    [encoder encodeObject:_allCards forKey:@"theDeck"];
    
}

